(6, 'Setelah Calon Siswa berhasil melakukan pendaftaran, Calon siswa wajib mencatat NOMOR PENDAFTARAN yang diperoleh dari sistem, guna untuk login ke sistem PPDB SEKOLAH NUSANTARA'),
