(15, NULL, '<p><br></p><p><img src=\"http://localhost/smartschool/image/header_surat.png\" style=\"width: 540px;\" class=\"fr-fic fr-dib\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-size: 18px;\">&nbsp;&nbsp;</span><span style=\"font-family: Times New Roman,Times,serif,-webkit-standard;\"><span style=\"font-size: 18px;\">&nbsp;</span><u><span style=\"font-size: 18px;\">SURAT IZIN KEGIATAN/REKOMENDASI</span></u></span></strong><span style=\"font-family: Times New Roman,Times,serif,-webkit-standard;\"><br> <span style=\"font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Nomor : 430/PPI.31/MA/IV/2019</span></span></p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;line-height:150%;\'>Yang bertanda tangan dibawah ini :</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin-left:36.0pt;text-align:justify;line-height:115%;\'>Nama &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : <strong>Drs.</strong> <strong>H. Yudi Wildan Latief, S.H, M.H&nbsp;</strong><br>NIP &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: -<br>Pangkat/gol.ruang &nbsp; &nbsp; &nbsp; : Kepala Madrasah Aliyah<br>Alamat sekolah &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Jl. Pajagalan No. 115 Banjaran Kab. Bandung</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:justify;line-height:150%;\'>Dengan ini mengizinkan dan merekomendasikan kepada Organisasi Ekstrakulikuler SANTCAKA (Santri Cinta Kelestarian Alam) MA PERSIS 31 Banjaran untuk menyelenggarakan kegiatan &ldquo;EKSPEDISI GUNUNG GEDE PANGRANGO SANTCAKA&rdquo; yang akan dilaksanakan pada:&nbsp;</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:justify;text-indent:36.0pt;line-height:115%;\'>Hari/Tanggal &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Sabtu &ndash; &nbsp;Selasa &nbsp; 13 &ndash; 16 April 2019<br><span style=\"margin-left:36.0pt;text-indent: 36pt;\">Tempat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Taman Nasional Gn. Gede Pangrango, Cibodas, Kab Cianjur, Jawa Barat</span><br><span style=\"margin-left:36.0pt;text-indent: 36pt;\">Peserta &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: 25 Orang</span><br><span style=\"margin-left:36.0pt;text-indent: 36pt;\">Penanggung Jawab &nbsp; &nbsp; : Rizky Fitrian</span><br><span style=\"margin-left:36.0pt;text-indent: 36pt;\">Pembina &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Elfa Maulana Yusron, S.Pd</span><span style=\"text-indent: 36pt;\">&nbsp;</span></p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:justify;line-height:150%;\'>Dengan ketentuan agar memperhatikan hal-hal sebagai berikut:</p><ol style=\"list-style-type: decimal;margin-left:11px;\"><li style=\'font-family: \"Times New Roman\", Times, serif, -webkit-standard; font-size: 16px;\'>Tidak mengganggu Kegiatan Belajar Mengajar</li><li style=\'font-family: \"Times New Roman\", Times, serif, -webkit-standard; font-size: 16px;\'>Menjaga keselamatan diri maupun rombongan</li><li style=\'font-family: \"Times New Roman\", Times, serif, -webkit-standard; font-size: 16px;\'>Tidak mengganggu ketertiban dan ketenangan masyarakat lingkungan tempat kegiatan dilaksanakan</li><li style=\'font-family: \"Times New Roman\", Times, serif, -webkit-standard; font-size: 16px;\'>Menjaga dan menjunjung tinggi nama baik Almamater MA PERSIS 31 Banjaran</li><li style=\'font-family: \"Times New Roman\", Times, serif, -webkit-standard; font-size: 16px;\'>Kegiatan dilaksanakan sesuai dengan proposal (perencanaan) yang ditetapkan</li><li style=\'font-family: \"Times New Roman\", Times, serif, -webkit-standard; font-size: 16px;\'>Memperhatikan waktu-waktu Sholat (kegiatan dihentikan mulai waktu adzan sampai selesai melaksanakan sholat) usahakan agar peserta melaksanakan sholat berjama&rsquo;ah di masjid terdekat</li><li style=\'font-family: \"Times New Roman\", Times, serif, -webkit-standard; font-size: 16px;\'>Menyampaikan laporan hasil kegiatan kepada Kepala Madrasah melalui kepala tata usaha, selambat-lambatnya satu minggu setelah kegiatan selesai dilaksanakan.</li></ol><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:justify;line-height:150%;\'>Demikian surat&nbsp;izin dan rekomendasi&nbsp;ini dibuat dengan sebenarnya untuk dapat dipergunakan sebagaimana mestinya.</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;line-height:150%;\'><span style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Banjaran, 04 April 2019</span><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 