(27, '', '<p><img src=\"http://localhost/smartschool/image/header_surat.png\" style=\"width: 540px;\" class=\"fr-fic fr-dib\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SURAT KEPUTUSAN<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; KEPALA MADRASAH TSANAWIYYAH PERSIS BANJARAN&nbsp;</strong><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nomor : 443/PPI.31/MA/IV/2019</p><p id=\"isPasted\" style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:center;\'><strong>TENTANG</strong></p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:center;line-height:150%;\'>PENGANGKATAN TENAGA PENDIDIK DAN TENAGA KEPENDIDIKAN</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:center;line-height:150%;\'>TAHUN PELAJARAN 2015/2016</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:center;line-height:150%;\'>&nbsp;</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:justify;text-indent:-78.0pt;line-height:115%;\'>Menimbang &nbsp; &nbsp; &nbsp; : Bahwa Kepala Madrasah adalah penanggung jawab atas penyelenggaraan kegiatan Pendidikan, administrasi Madrasah, santri dan kegiatan santri di Madrasah agar pelaksanaan tugas dan tanggung jawab tersebut lebih berhasil guna dan berdaya guna, maka Kepala Madrasah perlu dibantu oleh beberapa orang guru</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:justify;text-indent:-78.0pt;line-height:115%;\'>Mengingat &nbsp; &nbsp; &nbsp; &nbsp; : 1. Peraturan Pemerintah No. 29/1990.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2. UU No. 20 Tahun 2003 Bab. X Pasal 36<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3. Surat Kepala Kantor Kementrian Agama Kab. Bandung tentang Kalender Pendidikan<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4. Rapat dan Konsultasi dengan Pimpinan Pesantren Persis 31 Banjaran.</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:center;text-indent:-78.0pt;line-height:115%;\'><strong>MEMUTUSKAN</strong></p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;text-align:justify;text-indent:-78.0pt;line-height:115%;\'>Menetapkan &nbsp; &nbsp; &nbsp;:<br>Pertama &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Mengangkat dan menetapkan&nbsp;<strong>Rahman Taufiq, A.Md</strong> sebagai Tenaga Pendidik terhitung mulai tanggal 1 Juli 2015<br>Kedua &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Segala biaya yang timbul akibat pelaksanaan keputusan ini dibebankan kepada anggaran yang sesuai<br>Ketiga &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Apabila terdapat kekeliruan dalam keputusan ini akan diadakan perbaikan sebagaimana mestinya<br>Keempat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Keputusan ini berlaku sejak tanggal ditetapkan.<br>Ditetapkan di : BANJARAN</p><p><span style=\'font-size:16px;font-family:\"Times New Roman\",serif;\'>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Pada tanggal &nbsp;: 1 Juli 2015</span></p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;line-height:150%;\'><span style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Banjaran, 04 April 2019</span><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Kepala Madrasah,</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;line-height:150%;\'>&nbsp;</p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;line-height:150%;\'><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <u>Drs. H. Yudi Wildan Latief, S.H, M.H</u></strong></p><p style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;line-height:150%;\'>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; NIP. -&nbsp;</p><p id=\"isPasted\" style=\'margin:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin-left:78.0pt;text-indent:-78.0pt;\'><span style=\"font-size:13px;\">Tembusan :</span></p><ol style=\"list-style-type: decimal;\"><li><span style=\"font-size:13px;\">Yth. Kepala Kemenag Kab. Bandung</span></li><li><span style=\"font-size:13px;\">Yth. Ketua PC. PERSIS Banjaran</span></li><li><span style=\"font-size:13px;\">Yth. Pimpinan Pesantren Persis 31 Banjaran</span></li></ol>', NULL, '2023-01-27 19:08:11', 72);
